window.bookSummaryJSON = "<p>I vowed to protect my brother and my pack at all cost, but this time the debt for the protection might be my life.</p> <p>A war between my pack and the witches is long in the making. They'd do anything to destroy us. When a close ally is nearly killed by them, Josh goes rogue and retaliates. It's not without deadly consequences.</p> <p>While I'm handling the mayhem that's threatening to destroy my brother and pack, an alpha from another pack is causing havoc in the only thing in my life that isn't a wreck - my relationship with Sky.</p> <p>But losing Sky to another man becomes the least of my worries when her spirit shade forces her to cast a dark spell over the pack. Now I fear I might have to choose one: Sky's life or my pack?</p>"; 
